        body,
        html {
            height: 100%;
            margin: 0
        }

        #__next {
            display: flex;
            flex-direction: column;
            min-height: 100vh
        }

        .bg-button {
            background-image: /*savepage-url=/bigButt.png*/
            url()
        }

        .bg-button,
        .bg-mission {
            background-size: cover;
            background-position: 50%
        }

        .bg-mission {
            background-image: /*savepage-url=/backgroundGraphics.png*/
            url()
        }

        :root {
            --clr-primary: #00a8db;
            --clr-secondary: #fb0;
            --clr-bg: #30223b;
            --clr-neutral-900: #010101;
            --clr-neutral-100: #fff;
            font-family: Bubblegum, sans-serif;
            --fs-heading-lg: 3rem;
            --fs-heading-lg2: 3rem;
            --fs-heading-md: 2rem;
            --fs-body: 1rem
        }

        @media(min-width:60rem) {
            :root {
                --fs-heading-lg: 6.375rem;
                --fs-heading-md: 2.5rem;
                --fs-body: 1.5rem
            }
        }

        *,
        :after,
        :before {
            box-sizing: border-box
        }

        blockquote,
        body,
        dd,
        dl,
        figure,
        h1,
        h2,
        h3,
        h4,
        p {
            margin: 0
        }

        ol[role=list],
        ul[role=list] {
            list-style: none
        }

        html:focus-within {
            scroll-behavior: smooth
        }

        body {
            min-height: 100vh;
            text-rendering: optimizeSpeed;
            line-height: 1.5;
            overflow-x: hidden
        }

        a:not([class]) {
            text-decoration-skip-ink: auto
        }

        img,
        picture {
            max-width: 100%;
            display: block
        }

        button,
        input,
        select,
        textarea {
            font: inherit
        }

        @media (prefers-reduced-motion:reduce) {
            html:focus-within {
                scroll-behavior: auto
            }
            *,
            :after,
            :before {
                animation-duration: .01ms !important;
                animation-iteration-count: 1 !important;
                transition-duration: .01ms !important;
                scroll-behavior: auto !important
            }
        }

        body {
            color: var(--clr-neutral-100);
            background-color: var(--clr-bg);
            font-size: var(--fs-body);
            background-image: /*savepage-url=/newBackground.png*/
            var(--savepage-url-5);
            background-repeat: repeat;
            background-size: cover;
            font-family: Bubblegum, sans-serif !important
        }

        .navbar {
            width: min(1180px, 85%);
            margin-inline: auto;
            font-family: var(--ff-title);
            padding-block: 3rem
        }

        .nav-list,
        .navbar {
            display: flex;
            justify-content: space-between;
            align-items: center
        }

        .nav-list {
            width: 100%
        }

        .nav-primary,
        .nav-secondary {
            display: flex;
            justify-content: space-between;
            align-items: center;
            gap: 1.5rem;
            text-transform: uppercase;
            font-size: 1rem
        }

        .nav-primary {
            margin-inline: auto
        }

        @media(max-width:65rem) {
            .navbar {
                align-items: center
            }
            .nav-logo.fixed {
                position: fixed
            }
            .nav-toggle.toggled {
                position: fixed;
                top: 3.75rem;
                right: 2rem
            }
            .nav-toggle {
                display: block;
                background-color: transparent;
                border: none;
                cursor: pointer;
                outline: none;
                padding: 0;
                z-index: 10
            }
            .nav-toggle .icon-menu {
                display: inline-block;
                background-color: var(--clr-neutral-100);
                height: 3px;
                position: relative;
                transition: all .25s;
                width: 30px
            }
            .nav-toggle .icon-menu:after,
            .nav-toggle .icon-menu:before {
                content: "";
                background-color: var(--clr-neutral-100);
                height: 3px;
                left: 0;
                position: absolute;
                transition: all .25s;
                width: 30px
            }
            .nav-toggle .icon-menu:before {
                top: -8px
            }
            .nav-toggle .icon-menu:after {
                bottom: -8px
            }
            .nav-toggle.toggled .icon-menu {
                background-color: transparent
            }
            .nav-toggle.toggled .icon-menu:before {
                top: 0;
                transform: rotate(-45deg)
            }
            .nav-toggle.toggled .icon-menu:after {
                bottom: 0;
                transform: rotate(45deg)
            }
            .nav-list {
                display: none;
                position: absolute;
                top: 0;
                right: 3.75rem;
                transform: translateY(-7rem);
                padding: 2rem 1rem;
                background-color: var(--clr-neutral-900);
                max-width: 32rem;
                width: 85%;
                gap: 3rem;
                z-index: 10
            }
            .nav-toggle.toggled+.nav-list {
                display: block;
                position: fixed;
                inset: 0;
                height: 500px;
                background-color: var(--clr-neutral-900);
                z-index: 1;
                border-radius: 20px
            }
            .nav-list {
                margin: 14rem 2rem 0
            }
            .nav-list,
            .nav-primary,
            .nav-secondary {
                flex-direction: column
            }
        }

        .heading-lg,
        .heading-md {
            font-family: var(--ff-title)
        }

        .heading-lg {
            font-size: var(--fs-heading-lg)
        }

        .heading-md {
            font-size: var(--fs-heading-md)
        }

        .subtitle {
            font-family: var(--ff-title);
            font-size: 1rem
        }

        @media(min-width:45rem) {
            .heading-lg {
                line-height: 7rem
            }
        }

        .clr-primary {
            color: var(--clr-primary)
        }

        .clr-secondary {
            color: var(--clr-secondary)
        }

        .hero {
            position: relative;
            max-width: 730px;
            width: 85%
        }

        @media(min-width:60rem) {
            header {
                position: relative
            }
        }

        @media(min-width:45rem) {
            .hero__title {
                margin-bottom: 18rem
            }
            .hero__img {
                position: absolute;
                top: 5rem;
                left: 10%
            }
        }

        .about {
            position: relative;
            overflow: hidden;
            display: grid;
            place-items: center
        }

        .about--card {
            max-width: 900px;
            width: 85%;
            margin-inline: auto;
            background-color: var(--clr-neutral-900);
            padding: 1.5rem;
            line-height: 2.5rem
        }

        @media(min-width:60rem) {
            .about {
                position: relative;
                height: 65rem;
                overflow: hidden;
                display: grid;
                place-items: center;
                background-image: /*savepage-url=/images/red_planet.png*/
                url(), /*savepage-url=/images/green-ring-planet.png*/
                url();
                background-repeat: no-repeat;
                background-size: 28%, 25%;
                background-position: 0 0, top 5rem right -1.5rem
            }
            .about:before {
                transform: translate(-1.5rem, 24rem);
                background-image: /*savepage-url=/images/gold_coins-left.png*/
                url();
                background-size: 25%
            }
            .about:after,
            .about:before {
                content: "";
                position: absolute;
                inset: 0;
                background-repeat: no-repeat
            }
            .about:after {
                background-image: /*savepage-url=/images/gold_coins-right.png*/
                url();
                background-size: 30%;
                transform: translate(69%, 24rem) rotate(15deg)
            }
            .about--card {
                max-width: 900px;
                margin-inline: auto;
                background-color: var(--clr-neutral-900);
                place-self: end
            }
            .about--card:after {
                content: "";
                position: absolute;
                inset: 0;
                transform: translate(74%, 68%);
                background-image: /*savepage-url=/images/mamba_crown.png*/
                url();
                background-repeat: no-repeat;
                background-size: 30%;
                z-index: 10
            }
        }

        .features {
            position: relative;
            margin-block: 3rem
        }
